import React from "react";
import PropTypes from "prop-types";

import "./Header.scss";

const Header = (props) => {
  return (
    <div className="header">
      <div className="header--title">RANDOM</div>
      <div>RIGHT</div>
    </div>
  );
};

Header.propTypes = {};

export default Header;
